import { Parallax, Background } from 'react-parallax';
const bgimg = '/boqueh.jpg';
const Kisar = () => (
  <Parallax strength={300} bgImage={bgimg}>
    <Background className="custom-bg">
      <h2>kisar</h2>
      <img src="/boqueh.jpg" alt="fill murray" />
    </Background>
  </Parallax>
);
export default Kisar;
